import React , {useState} from 'react';
import FilterGallery from './FilterGallery';
import SecondFilterGallery from './SecondFilterGallery';




function Games_Page(){

    const [Gclick , SetGclick] = useState(false);
    const [Hclick , SetHclick] = useState(false);

    function changev(){
        SetGclick (true);
        SetHclick(false);
    }

    function changeb(){
        SetGclick (false);
        SetHclick(true)
    }
    return(
        <>
            <div className='button-container d-flex justify-content-center bg-danger my-4 p-4'>
                <button onClick={changev} className='w-25 mx-5 p-4'>Get Weapon NFT</button>
                <button onClick={changeb} className='w-25 mx-5'>Get Armour NFT</button>
            </div>
            
            {Gclick && <FilterGallery/>}
            {Hclick && <SecondFilterGallery/>}

        </>
    )
}

export default Games_Page;
